import classes from "./Modal.module.css";
import React from "react";
import Cart from "../cart/Cart";
let Backdrop = (props) => {
  return (
    <div className={classes.backdrop}>
      <div className={classes.modal}>
        <Cart />
      </div>
    </div>
  );
};
let Modal = () => {
  return <div>{React.createPortal()}</div>;
};
export default Modal;
